CREATE TABLE pokemons(
   pokemon_id SERIAL PRIMARY KEY,
   pokedex_number INTEGER  NOT NULL,
   pokemon_name VARCHAR(25) NOT null,
   pokemon_type VARCHAR(8) NOT null,
   other_type  VARCHAR(8),
   total_power INTEGER  NOT null,
   hit_points  INTEGER  NOT null,
   attack_strength INTEGER  NOT null,
   defence_strength INTEGER  NOT null,
   special_attack_strength INTEGER  NOT null,
   special_defence_strength INTEGER  NOT null,
   speed      INTEGER  NOT null,
   generation_number INTEGER  NOT null,
   is_legendary BOOLEAN DEFAULT FALSE NOT null,
   pokemon_photo_url VARCHAR(255)
);

